    console.log(props, 'props');
    return (

        <Layout title="Home">
            <Search />
        </Layout>
    )
};

Index.getInitialProps = async function (ctx: any) {
    const res = await ctx.store.dispatch(actions.getProduct());
    return { ...res }
    // initialize(ctx);
};


export default connect(state => state)(Index);
